import Seller from "./Seller";

function Display({name, price, pictures, seller}){


    return (<div>
    <div>{name}</div>
    <div>{price}</div>
    <div>{pictures}</div>
    <div>{seller.name}</div>
    </div>
    
    )
}

export default Display;
